  	var SI = CFB.find(cfb, '!SummaryInformation');
  	if(SI && SI.size > 0) try {
  		var Summary = parse_PropertySetStream(SI, SummaryPIDSI, PSCLSID.SI);
  		for(var s in Summary) if(props[s] == null) props[s] = Summary[s];
  	} catch(e) {if(o.WTF) throw e;/* empty */}

